import {React, useState} from 'react';
import ChatBot from "react-chatbotify";
import "./Caelestis.css";
import { supabaseConexion } from '../../config/supabase';

const Caelestis = () => {
    const valorInicial={};
	const [form, setForm] =useState(valorInicial);

	const formStyle = {
		marginTop: 10,
		marginLeft: 20,
		border: "1px solid #491d8d",
		padding: 10,
		borderRadius: 5,
		maxWidth: 300
	}

	const flow = {
		start: {
			message: "¡Bienvenido a SSLife! ¿Cuál es tu nombre?",
			function: (params) => setForm({ ...form, name: params.userInput }),
			path: "greet_user"
		},
		greet_user: {
			message: (params) => `¡Encantado de conocerte, ${params.userInput}!`,
			transition: { duration: 1000 },
			path: "explain_sslife"
		},
		explain_sslife: {
			message: "SSLife es una plataforma dedicada a combatir el acoso escolar y la soledad. Ofrecemos apoyo emocional y recursos para aquellos que lo necesitan.",
			transition: { duration: 1000 },
			path: "write_message"
		},
		write_message: {
			message: "¿Te gustaría escribir una carta o un mensaje para sentirte mejor? Puedes escribirlo aquí.",
			user: true,
			function: (params) => {
				const mensajeNuevo = params.userInput;
				setForm({ ...form, mensajeUsuario: mensajeNuevo });
				guardarMensaje(form.name, mensajeNuevo); 
			},
			path: "repeat_message"
		},
		repeat_message: {
			message: (params) => `Aquí está tu mensaje: "${form.mensajeUsuario}". ¿Quieres repetirlo o hacer algo más?`,
			options: ["Repetir", "Hacer otra cosa"],
			function: (params) => {
				if (params.userInput === "Repetir") {
					params.triggerNextStep({ trigger: "repeat_message" });
				} else {
					params.triggerNextStep({ trigger: "end" });
				}
			}
		},
		end: {
			message: "Gracias por usar SSLife. Si necesitas más ayuda, no dudes en volver.",
			render: (
				<div style={formStyle}>
					<p>Nombre: {form.name}</p>
					<p>Mensaje: {form.mensajeUsuario}</p>
				</div>
			),
			options: ["Nueva consulta"],
			path: "start"
		},
	};

	const guardarMensaje = async (name, message) => {
		const { data, error } = await supabaseConexion
			.from('caelestis')
			.insert([{ nombre_usuario: name, mensaje: message, fecha: new Date() }]);

		if (error) {
			console.error('Error guardando el mensaje:', error);
		} else {
			console.log('Mensaje guardado:', data);
		}
	};

	return (
		<ChatBot
			options={{
				header:{
					title: "Caelestis",
					avatar: "data:image/jpeg;base64,",
				},
				tooltip:{
					text: "¡Háblame!",
				},
				bodyStyle: {
					"background": "#f0f0f0"
				},
				chatHistoryButtonStyle: {
					"background": "#198754",
					"color": "#ffffff"
				},
				chatHistoryButtonHoveredStyle: {
					"background": "#00796b"
				},
				chatInputContainerStyle: {
					"background": "#ffffff"
				},
				chatInputAreaStyle: {
					"background": "#e0e0e0",
					"color": "#000000"
				},
				botBubbleStyle: {
					"background": "#46805f"
				},
				userBubbleStyle: {
					"background": "#5ad584"
				},
				headerStyle: {
					"background": "#198754"
				},
				botOptionStyle: {
					"background": "#198754",
					"color": "#ffffff"
				},
				botOptionHoveredStyle: {
					"background": "#00796b",
					"color": "#ffffff"
				},
				chatHistoryLineBreakStyle: {
					"color": "#46805f"
				},
				botCheckboxNextStyle: {
					"background": "#198754",
					"color": "#ffffff"
				},
				botCheckboxRowStyle: {
					"background": "#b2dfdb",
					"color": "#004d40"
				},
				botCheckMarkStyle: {
					"background": "#00796b"
				},
				footerStyle: {
					"background": "#198754",
					"color": "#ffffff"
				},
				sendButtonStyle: {
					"background": "#5ad584"
				},
				sendButtonHoveredStyle: {
					"background": "#198754"
				}
			}
			}
			flow={flow}
		/>
	);
};

export default Caelestis;